import React from 'react';
import PropTypes from 'prop-types';

AblumList.propTypes = {
  albumList: PropTypes.array
};

function AblumList(props) {
  const { albumList } = props;
  return (
    <div>
      <ul>
        {albumList.map(item => {
          return <li key={item.id}></li>
        })}
      </ul>
    </div>
  );
}

export default AblumList;
